import React from 'react'
import './File.css'
export const File=({ input,name, type,file}) => {
    delete input.value
    return (
        <div>
            <label className="fileBlock" htmlFor={input.name}>
            Загрузить фото
                <input class="file"{...input} type={type} file={file}name={name} />
            </label>
        </div>
    )
}
